      </div>
      <h3>Flagment</h3>
      <p>
        Lorem ipsum dolor sit amet consectetur, adipisicing elit. Itaque nobis
        odit doloribus cumque dolore necessitatibus soluta assumenda quod veniam
        praesentium officia at, exercitationem hic amet! Fugiat explicabo sit id
        odio?
      </p>
    </>
  );
};

export default Child;
